import React, { useCallback } from 'react';

const UserProfile = ({ setIsLoggedIn }) => {
	const logOut = useCallback(() => {
		setIsLoggedIn(false);
	}, []);
	return <div>UserProfile</div>;
};

export default UserProfile;
